import React from "react";

const Contact = () =>{
    
    return(
        <>
            <div className="my-5">
               <h1 className="text-center">Contact Us</h1>
           </div>
           <div className="container-fluid contact_div">
            <div className="row">
                 <div className="col-10 mx-auto">
                     
                 </div>
            </div>
        </div>
        </>
    );
}

export default Contact;
